import React, { useState } from "react";
import Todo from "./components/Todo.js";

function App() {
  const [todos, setTodos] = useState([
    {
      text: "Learn about React",
      isCompleted: false
    },
    {
      text: "Make ToDo App",
      isCompleted: false
    },
    {
      text: "Get $$$",
      isCompleted: false
    }
  ]);

  return (
    <div className="app">
      <div className="todo-list">
        {todos.map((todo, index) => {
          <Todo key={index} index={index} />;
        })}
      </div>
    </div>
  );
}

export default App;
